/// 联系人Errno
public enum OpenAPIContactErrno: Int, OpenAPIErrnoProtocol {
    // 参数错误，choosenIds 和 disableChosenIds 有交集
    case ChoosenIdsAndDisableChosenIdsIntersect = 1
    // 数据异常
    case NetworkDataException = 2
    // 取消
    case cancel = 3

    public var bizDomain: Int { 10 }
    public var funcDomain: Int { 3 }

    public var errString: String {
        switch self {
        case .ChoosenIdsAndDisableChosenIdsIntersect:
            return "Parameter error. Some values exist in both choosenIds and disableChosenIds."
        case .NetworkDataException:
            return "Data exception."
        case .cancel:
            return "Cancel."
        }
    }
}
